webpackJsonp([47],{"./node_modules/json-loader/index.js!./.cache/json/community-blog.json":function(e,t){e.exports={data:{allFile:{edges:[{node:{relativePath:"community/articles-and-videos.md",childMarkdownRemark:{frontmatter:{title:"Articles and Videos",order:0}}}},{node:{relativePath:"community/blog.md",childMarkdownRemark:{frontmatter:{title:"Blog",order:0}}}},{node:{relativePath:"community/events.md",childMarkdownRemark:{frontmatter:{title:"Events",order:3}}}},{node:{relativePath:"community/examples.md",childMarkdownRemark:{frontmatter:{title:"Examples",order:1}}}},{node:{relativePath:"community/index.md",childMarkdownRemark:{frontmatter:{title:"Community",order:0}}}},{node:{relativePath:"community/roadmap.md",childMarkdownRemark:{frontmatter:{title:"Roadmap",order:2}}}},{node:{relativePath:"community/faq.md",childMarkdownRemark:{frontmatter:{title:"Frequently Asked Questions",order:9}}}}]},file:{relativePath:"community/blog.md",childMarkdownRemark:{html:'<h3 id="new-website"><a href="#new-website" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>New website!</h3>\n<p>July 14, 2017</p>\n<p>Notice anything different? =)</p>\n<p>The new documentation website is built by our community member <a href="https://jaredforsyth.com">Jared</a> (make sure to check his Reason blog posts too!). The new site keeps most of the same content from the old one, while providing a better structure to navigate through them. You\'ll notice "Suggest an edit" links all over the place. Take a look around!</p>\n<p>(Built with <a href="https://www.gatsbyjs.org">Gatsby</a>)</p>\n<h3 id="new-reasonreact-version-released"><a href="#new-reasonreact-version-released" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>New ReasonReact version released</h3>\n<p>June 12, 2017</p>\n<p>Very exciting release! Short version: ReasonReact now has its own documentation site <a href="https://reasonml.github.io/reason-react/">here</a>. Accompanying this is the new <a href="https://www.npmjs.com/package/bs-platform">BuckleScript</a> release. Both are non-breaking.</p>\n<p>Enjoy!</p>\n<h3 id="spring-cleaning-first-blog-post"><a href="#spring-cleaning-first-blog-post" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Spring Cleaning (First Blog Post!)</h3>\n<p>May 18, 2017</p>\n<p>Now that the community is taking off, keeping folks up-to-date through <a href="https://discord.gg/reasonml">Discord</a> and other existing channels became less ideal. We\'re starting a blog post section for this reason. In the spirit of the community, these posts will stay short and concise.</p>\n<p>We\'ve moved unused first-party projects from <a href="https://github.com/reasonml/">GitHub/reasonml</a> to <a href="https://github.com/reasonml-old">GitHub/reasonml-old</a>. Old URLs are redirected, so no breackage here.</p>\n<p>We\'ve cleaned up the Reason codebase. Editor integrations moved out to their dedicated repos. Updated instructions are still <a href="/guide/tools#editor-integration">here</a>. Other Reason repo cleanups are still ongoing.</p>\n<p>Some discord rooms got merged together. Fewer rooms, more focused discussions.</p>\n<p>As you can see: this documentation site got a few rearrangements too. In general, if you\'d like to contribute to docs, please ping us on Discord!</p>',frontmatter:{title:"Blog"}}}},pathContext:{section:"community",sectionTitle:"Community",relativePath:"community/blog.md",relatedFiles:"/^community\\/.*\\.md$/"}}}});
